import React from 'react';

export const KeywordBubble = (props) =>{

    //below is the basic button styling I made to be able to see the buttons, this won't exist (here at least) when you're done -anacan
    const buttonStyle = {
        borderRadius: "15px",
        width: "120px",
        height: "75px",
        backgroundColor: "black",
        color: "white",
        right: 0,
        top: "50px",
        position: 'absolute'
    }
    const buttonStyle2 = {
        borderRadius: "15px",
        width: "120px",
        height: "75px",
        backgroundColor: "black",
        color: "white",
        right: 0,
        top: "100px",
        position: 'absolute'
    }
    return(
        <div>
          <button1 variant = "contained" onClick = {() => props.setQuery(props.a)} style = {buttonStyle}>{props.a}</button1>
          <button2 variant = "contained" onClick = {() => props.setQuery(props.a)} style = {buttonStyle2}>{props.a}</button2>

        </div>
    );
}
